import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      races: [
        {
          id: 1,
          name: "Genasi"
        },
        {
          id: 2,
          name: "Dragonborn"
        },
        {
          id: 3,
          name: "Goliath"
        },
        {
          id: 4,
          name: "Aasimar"
        }
      ]
    }
  }

  componentDidMount() {
    fetch("http://jsonplaceholder.typicode.com/users")
    .then(response => response.json)
  }

  render() {
    return (
        <div className="App">
          {
            this.state.races.map(race => <h1 key={race.id}> { race.name } </h1>)
          }
        </div>
      );
  }
}

export default App;
